

class Solution:

    def strStr_elegant(self, haystack: str, needle: str) -> int:
        '''Elegant, but just as slow'''
        i = 0
        while True:
            print("Start", i)
            j = 0
            while True:
                print("\t j", j, "start", i)

                if j == len(needle):
                    return i
                if i+j == len(haystack):
                    return -1
                if needle[j] != haystack[i + j]: 
                    break
                j += 1
            i += 1

    def strStr(self, haystack: str, needle: str) -> int:
        '''BF involves trying out all possible starting indexes in haystack and matching all characters of needle onward
            using two pointers, but this implementation is too slow, except for a small optimization.
            We check only viable starting points: let i go from 0 to len-len(needle)'''
        # FOR LOOPS ARE FASTER THAN WHILE LOOPS
        for i in range(len(haystack) - len(needle) + 1):
            for j in range(len(needle)):
                if needle[j] != haystack[i+j]:
                    break
            else:
               return i
        
        return -1
        ## NOTE: LEETCODE WILL GIVE TLE BECAUSE PYTHON IS TOO SLOW OR BECAUSE KMP ALGO IS EXPECTED
        ## For high level languages like Python or swift, you should use KMP to pass TLE
                    
